content:
Thank you to @dandcaldwell and @ConcernedVets for your support.

@RepMeijer and I are working to repeal inactive, outdated AUMFs because Members of Congress owe it to every U.S. servicemember to have a public debate and vote on the use of force overseas.
newsweek.com/congress-has-c…

Great to be in Bay City with Habitat for Humanity to help build a ramp for someone in need.

I'm working in Congress now to secure funding for initiatives to help repair homes across mid-Michigan.
@Habitat_org @LIUNA https://t.co/qeqZgXu9Ya
